import React, { useState } from 'react';
import {
  View,
  Text,
  TouchableOpacity,
  ScrollView,
  SafeAreaView,
} from 'react-native';
import { useNavigation } from '@react-navigation/native';
import { Ionicons } from '@expo/vector-icons';
import SafeMitraLogo from '../../components/SafeMitraLogo';
import styles from '../styles-part/DashboardScreenStyles';

const DashboardScreen = () => {
  const navigation = useNavigation();
  const [isLocationActive, setIsLocationActive] = useState(true);

  const handleSecureDataPress = () => {
    navigation.navigate('EvidenceSecure');
  };

  return (
    <SafeAreaView style={styles.container}>
      {/* Header */}
      <View style={styles.header}>
        <View style={styles.logoContainer}>
          <SafeMitraLogo color="#FF3B30" size={30} />
          <Text style={styles.logoText}>SafeMitra</Text>
        </View>
      </View>

      <ScrollView contentContainerStyle={styles.scrollContent}>
        <View style={styles.content}>
          {/* Status Banner */}
          <View style={styles.statusBanner}>
            <Text style={styles.statusTitle}>You are Safe</Text>
            <Text style={styles.statusSubtitle}>Last updated 2 minutes ago</Text>
          </View>

          {/* Status Shield */}
          <View style={styles.shieldContainer}>
            <View style={styles.shield}>
              <Ionicons name="shield" size={60} color="#FF3B30" />
            </View>
            <Text style={styles.shieldTitle}>SafeMitra is watching over you</Text>
            <Text style={styles.shieldSubtitle}>Your current location is being monitored</Text>
          </View>

          {/* Live Location Status Card */}
          <View style={styles.statusCard}>
            <View style={styles.statusHeader}>
              <Ionicons name="location" size={24} color="#FF3B30" />
              <Text style={styles.statusTitle}>Live Location Status</Text>
            </View>
            <View style={styles.statusContent}>
              <View style={[styles.statusIndicator, { backgroundColor: isLocationActive ? '#4CAF50' : '#FF3B30' }]} />
              <Text style={styles.statusText}>
                {isLocationActive ? 'Active' : 'Inactive'}
              </Text>
            </View>
          </View>

          {/* Card Grid */}
          <View style={styles.cardGrid}>
            <TouchableOpacity 
              style={styles.card} 
              onPress={() => navigation.navigate('LiveLocationStatus')}
            >
              <Ionicons name="location" size={32} color="#FF3B30" />
              <Text style={styles.cardTitle}>Live Location</Text>
            </TouchableOpacity>

            <TouchableOpacity 
              style={styles.card} 
              onPress={() => navigation.navigate('HotwordDetection')}
            >
              <Ionicons name="mic" size={32} color="#FF3B30" />
              <Text style={styles.cardTitle}>Voice Alert</Text>
            </TouchableOpacity>

            <TouchableOpacity 
              style={styles.card} 
              onPress={() => navigation.navigate('EmergencySOS')}
            >
              <Ionicons name="alert-circle" size={32} color="#FF3B30" />
              <Text style={styles.cardTitle}>Emergency SOS</Text>
            </TouchableOpacity>

            <TouchableOpacity 
              style={styles.card} 
              onPress={handleSecureDataPress}
            >
              <Ionicons name="shield-checkmark" size={32} color="#FF3B30" />
              <Text style={styles.cardTitle}>Secure Data</Text>
            </TouchableOpacity>
          </View>
        </View>
      </ScrollView>

      {/* Footer Navigation */}
      <View style={styles.footer}>
        <TouchableOpacity 
          style={styles.footerIcon}
          onPress={() => navigation.navigate('Splash')}>
          <Ionicons name="home" size={24} color="#FF3B30" />
          <Text style={styles.footerText}>Home</Text>
        </TouchableOpacity>
        <TouchableOpacity style={styles.footerIcon}>
          <Ionicons name="settings" size={24} color="#666666" />
          <Text style={styles.footerText}>Settings</Text>
        </TouchableOpacity>
        <TouchableOpacity style={styles.footerIcon}>
          <Ionicons name="person" size={24} color="#666666" />
          <Text style={styles.footerText}>Profile</Text>
        </TouchableOpacity>
      </View>
    </SafeAreaView>
  );
};

export default DashboardScreen;
